import React from "react";
import { HashRouter, Route, Routes } from "react-router-dom";
import Home from "./routes/Home";

function App() {
  return (
    <HashRouter>
      <Routes>
        <Route path="/" exact={true} component={Home} />
      </Routes>
    </HashRouter>
  );
}

export default App;
